import './App.css';
import Sidebar from './defultComponent/sidebar';

export default function App() {
  return (
    <BrowserRouter>
    <Router>
      <Routes>
        < Sidebar />
        <Route path='/' />
        <Route path='/menu' />
      </Routes>
    </Router>
    </BrowserRouter>
  );
}

